import {
    createAction 
}
from "./createAction";

const onUppdateTime = createAction({
    name: "ON_UPPDATE_Time",
    payload: [
        "seconds"
    ]
});

const onSetIndicator = createAction({
    name: "ON_SET_INDICATOR",
    payload: [
        "indicator"
    ]
});

export {
    onUppdateTime,
    onSetIndicator
}
